    public class InvestingComSource : ICurrencyDataSource
    {
        private List<IElement> _elements = new List<IElement>();
        private const string Link = "https://www.investing.com/currencies/usd-uah-chart";
        public List<CurrencyItem> GetSource()
        {
            return new List<CurrencyItem>()
            {
                GetSource(CurrencyTypes.USD, "https://www.investing.com/currencies/usd-uah-chart", "pid-2208-bid", "pid-2208-ask"),
                GetSource(CurrencyTypes.EUR, "https://www.investing.com/currencies/eur-uah-chart", "pid-1709-bid", "pid-1709-ask"),
                GetSource(CurrencyTypes.GBP, "https://www.investing.com/currencies/gbp-uah-chart", "pid-1800-bid", "pid-1800-ask"),
                GetSource(CurrencyTypes.CNY, "https://www.investing.com/currencies/cny-uah-chart", "pid-940807-bid", "pid-940807-ask")
            };
        }

        private CurrencyItem GetSource(string type, string link, string buyId, string sellId)
        {
            ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls | SecurityProtocolType.Tls11 | SecurityProtocolType.Tls12 | SecurityProtocolType.Tls13;
            var doc = "";

            var request = new RestRequest("/", Method.GET);
            var client = new RestClient(link);
            var response = client.Execute(request);

            if (response.StatusCode != HttpStatusCode.OK)
                throw new Exception($"Unable to download file");

            doc = response.Content;

            _elements = new HtmlParser().ParseDocument(doc).All.Where(m => m.LocalName == "span").ToList();

            return
                new CurrencyItem(Helpers.SourceListHelper.InvestingCom)
                {
                    Buy = GetData(buyId),
                    Sell = GetData(sellId),
                    Type = type
                };
        }

